import {createSlice} from "@reduxjs/toolkit";

const appReducer = createSlice({
  name: 'appReducer',
  initialState: {
    isAppReady: false
  },
  reducers: {
    setAppReady: (state, action) => {
      state.isAppReady = action.payload
    }
  }
})

export const {setAppReady} = appReducer.actions
export default appReducer.reducer
